import { useEffect, useState } from "react";
import Records from '../data.json';

function Cases() {

  useEffect(() => {
      document.title = 'Cases';
  }, []);

    return (
        <section className="section site-portfolio container">
            <div className="row mb-3 align-items-center">
              <div class="col-md-12 col-lg-6 mb-4 mb-lg-0" data-aos="fade-up">
                <h2>Cases</h2>
              </div>
            </div>
            {Records.map(record => {
            return (
            <div id="portfolio-grid" className="row no-gutter" data-aos="fade-up" data-aos-delay="200" key={record.id}>
                 <h3>{record.name}</h3>
                 <img src={record.image} style={{width: 300}} />
                <p>{record.category}</p>
            </div>
            )
            })}
        </section>
    );
}

export default Cases;
